import React from "react";
import { Link } from "react-router-dom";
import "../style/_nav.scss";
import {link} from 'react-router-dom'



class NavBar extends React.Component {
  render() {
    return (
      <nav className="menu">
        <ul>
        <Link to="./">
          <li>Accueil</li>
        </Link>
        <Link to="./About.js">
          <li>A propos</li>
          </Link>
        </ul>
      </nav>
    );
  }
}

export default NavBar;
